import SignUp from './SignUp';

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Chatroom App</h1>
      </header>
      <main>
        <SignUp />
      </main>
    </div>
  );
};

export default App;
